import React, { Component } from "react";
import Navbar from "./components/layout/Navbar";
import useritem from "./components/users/UserItem";
import "./App.css";

class App extends Component {
  render() {
    return (
      <div className="App">
        <Navbar />
        <UserItem />
      </div>
    );
  }
}

export default App;
